import React from 'react'
import { NavLink } from 'react-router-dom'
function Header() {
    return (
        <div>
            {/* NAVBAR */}
            <nav className="navbar navbar-expand-lg navbar-dark fixed-top" style={{ background: 'transparent' }}>
                <div className="container">
                    <a className="navbar-brand d-flex align-items-center" href="#">
                        <i className="bi bi-egg-fried text-warning me-2 fs-2" />
                        <span>Restoran</span>
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navMenu">
                        <span className="navbar-toggler-icon" />
                    </button>
                    <div className="collapse navbar-collapse" id="navMenu">
                        <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
                            <li><NavLink className="nav-link active" to="/">HOME</NavLink></li>
                            <li><NavLink className="nav-link" to="/ABOUT">ABOUT</NavLink></li>
                            <li><NavLink className="nav-link" to="/SERVICE">SERVICE</NavLink></li>
                            <li><NavLink className="nav-link" to="/MENU">MENU</NavLink></li>
                            <li><NavLink className="nav-link" to="/PAGES">PAGES</NavLink></li>
                            <li><NavLink className="nav-link" to="/CONTACT">CONTACT</NavLink></li>
                        </ul>
                        <NavLink to="/BOOK A TABLE" className="btn btn-book ms-3">BOOK A TABLE</NavLink>
                    </div>
                </div>
            </nav>
            {/* HERO SECTION */}
            <section className="hero-section">
                <div className="container hero-content">
                    <div className="row align-items-center">
                        {/* LEFT TEXT */}
                        <div className="col-lg-6">
                            <h1 className="hero-title">Enjoy Our<br />Delicious Meal</h1>
                            <p className="hero-para">
                                Tempor erat elitr rebum at clita. Diam dolor diam ipsum sit. Aliqu diam amet diam et eos.
                                Clita erat ipsum et lorem et sit, sed stet lorem sit clita duo justo magna dolore erat amet.
                            </p>
                            <button className="hero-btn">BOOK A TABLE</button>
                        </div>
                        {/* RIGHT IMAGE */}
                        <div className="col-lg-6 text-center">
                            <img src="https://img.freepik.com/free-photo/top-view-barbecue-grill-with-steak-vegetables_23-2148536053.jpg" className="img-fluid hero-img rounded" alt="food" />
